import styled from 'styled-components';


export const PageContainer = styled.div`
    width: 100vw;
    /* height: 100vh; */
    height:auto;
    display: flex;
    flex-direction: column;
    background: #F0F0F0;
`;

export const HeadersContainer = styled.div`
    position: fixed;
    height: 150px;
`;
